            var geoJsonLayer = L.geoJson([{'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2014-04-01', 'timestamp': '2014-04-01 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/4oB-qu5Ow-k" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Peregrine chicks feeding', 'description': '3 day old peregrine chicks at Salisbury Cathedral feeding time with their mum', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=4oB-qu5Ow-k', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2014-04-01', 'timestamp': '2014-04-01 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/Ta9_ViCQuJU" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Peregrines chicks being ringed', 'description': 'Peter the peregrine chick is ringed by Ed Drewett in this video.', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=Ta9_ViCQuJU&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=34', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2015-05-27', 'timestamp': '2015-05-27 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/MYclD2AymvI" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'RSPB climb Tower to ring Peregrine Chicks\n', 'description': 'Four peregrine chicks, two male and two female, recently hatched on Salisbury Cathedral\x92s tower were ringed yesterday by a team from the RSPB including specialist, Ed Drewitt.\n \nIn the late afternoon the young birds were removed from their nesting box, weighed, measured and then ringed with bright blue identification rings carrying their unique number. The job had to be done quickly so as not to distress the chicks but there was still time to draw names supplied by Cathedral staff out of a hat. The two males are now called Anthony (possibly after our head verger!) and George (a right royal name). The females are Kate (another royal name) and Justice (to reflect our 1215 Magna Carta values).\n \nThis is only the second time since 1953 that the Cathedral peregrines have successfully hatched eggs at Salisbury Cathedral. Last year three peregrine offspring fledged. \n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=MYclD2AymvI', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2016-05-17', 'timestamp': '2016-05-17 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/3Agos7UfYnA" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': '2 more peregrine chicks', 'description': 'Four peregrine chicks have hatched in the nest box at the top of the Cathedral Tower. two more emerged this morning, Tuesday, 17 May. There was some anxiety about the fourth egg, but that chick popped out at around 17.15 tonight.\n\nGary Price, Clerk of the Works said: \n\n\x93The female laid her first egg on Easter Monday and then there was a long gap before the remaining three came along and during that time she wasn\x92t incubating it. We were a bit concerned but it has all turned out fine.\x94\n\nCathedral and RSPB staff, volunteers and visitors have been observing developments in and around the nesting box since just before Holy Week, when the peregrines settled down at the base of the Spire. HD cameras are relaying pictures live to monitors in the Cloisters and at the top of the Tower. \n\nPhilip Sheldrake, RSPB Conservation officer said:\n\n\x93To have four hatched chicks this year, after the successful fledging of four youngsters last year, is great. We have been wondering whether this is the same mother, or a younger female. It\x92s hard to tell. Certainly there was a long spell between the first egg and final egg being laid, which might be an indicator.\x94\n\nSeven young peregrines have been successfully fledged from the Cathedral Tower since 2014 thanks to the Cathedral team led by Gary Price, Clerk of The Works, and Philip Sheldrake, RSPB Conservation Officer and RSPB volunteers.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=3Agos7UfYnA', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-04-02', 'timestamp': '2017-04-02 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/VjxVzrCr3o4" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Two eggs so far...how many more? \n', 'description': ' the second egg before dawn on Sunday, 2 April.\n\nGenerally peregrines lay between 3 and 4 eggs but this can vary. We have heard of instances where as many as six have been laid. \n\nA high number of eggs doesn\'t guarantee breeding success. We\'ve done some reading up on this subject and here\'s what the Sheffield Bird Study Group had to say on the subject in 2015. The author is Dr Nicola Hemmings of the Department of Animal and Plant Sciences at the University of Sheffield:\n\n"Hatching failure is a common problem...in general, a small proportion of eggs (i.e. 1-2%) remain unhatched, but occasionally entire clutches fail. The extent of hatching failure varies markedly across birds and tends to be higher in endangered species. This year (2015), the Sheffield Peregrines experienced a fairly high level of loss: 50% hatching failure."\n\nDr. Hemmings explains that there are two main reasons why eggs fail  - infertility or embryo death. We have been lucky so far but until the chicks hatch we are not into safe waters - and even then one never knows.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=VjxVzrCr3o4&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=38', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-04-01', 'timestamp': '2017-04-01 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/RGWzPUegmqo?start=3227" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'more mating', 'description': 'more mating increases the odds of fertilisation', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/RGWzPUegmqo?t=3226', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-04-11', 'timestamp': '2017-04-11 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/RGWzPUegmqo?start=2945" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': '4th egg ', 'description': '4th egg on Tuesday (11 April) ', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/RGWzPUegmqo?t=295', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-04-13', 'timestamp': '2017-04-13 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/_g6fXzz4SQ0" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Jackdaw and very plucky pigeon visit the nest ', 'description': 'During incubation we have seen jackdaws and pigeons strolling around the balcony. They are generally only in danger when airborne and the pigeon in this clip is bold enough to inspect the eggs. The visitor to watch is the jackdaw, who will steal eggs. This one seems to be content to collect sticks for nesting.', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=_g6fXzz4SQ0&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=37\n', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-04-14', 'timestamp': '2017-04-14 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/wJEdimlkQV0" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': '5th egg', 'description': "5th egg was spotted on Good Friday (14 April)  Just when we thought laying was over, this happened...a fifth egg. Here's a rundown:\n\nThe five day gap between the second and third eggs threw us a bit. Generally peregrines lay every two to three days.\n\nPeregrines produce between three and four eggs on average, though in urban areas it has been known for some peregrines to lay as many as six. The female starts incubating the eggs when her clutch is almost complete i.e when the penultimate egg has been laid. The eggs are incubated for around 29-35 days, though this can vary depending on weather and conditions.\n", 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=wJEdimlkQV0&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=46', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-04-20', 'timestamp': '2017-04-20 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/_g6fXzz4SQ0" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'pigeon on nest', 'description': "Never mind the predator, a pigeon visits the nest site. \nWe've been fascinated by the pigeons that seem to be happy to visit and even approach the nest when the peregrine is in residence. This is probably because falcons only hunt in flight, so when the raptor is on the nest the visiting pigeon isn't a risk. Still rather a bold move, we think.\n", 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=_g6fXzz4SQ0&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=37', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-04-24', 'timestamp': '2017-04-24 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/gZSnjfIhXLM" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'A shift change at the nesting box', 'description': 'Although the female does most of the incubating, the male peregrine plays his part and this year we have noticed that he seems to have been a particularly attentive father. You can see here how much larger the female is than the male. Females are noticeably heavier than males and have relatively larger feet and larger talons', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=gZSnjfIhXLM&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=39', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-05-12', 'timestamp': '2017-05-12 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/gZSnjfIhXLM" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Sally tagged and named Female peregrine released after satellite tagging \n', 'description': "This year we took the unusual step of tagging and ringing the female peregrine. Our Clerk of the Works also named her Sally. \n\nDave Anderson, the specialist who tagged Sally, kept her calm by hooding her and ensured the tagging process was as quiet and quick as possible. The only time Sally flapped was when he encouraged her to do so, in order to check that the tag was properly fitted and didn't impede flight.\n\nPhil Sheldrake, RSPB Conservation officer, who assisted with the tagging, was given the honour of releasing her. Then an anxious wait for her to return to the nest followed. In Dave's experience it can take up to an hour. Much to everyone's relief she returned to her eggs and settled down.\n\nWe also ringed our male peregrine and named him Sebastian, but he was too light to tag. We hope that the rings on both birds (SY for Sally, SN for Sebastian) and Sally's satellite tag will help us to learn more about them and, to some extent, to protect them. \n\n\nFirst adult Peregrine in UK to get satellite tracker\nOn Friday 12 May, history was made when the British Trust for Ornithology (BTO) fitted a satellite tag to our female peregrine nesting on the South Tower balcony. \n\nThe tagging of the nesting female, filmed by BBC Springwatch, is the first of its kind in the UK and carried out by specialist Dave Anderson under the supervision of Ed Drewitt, who holds a licence to ring and tag birds in the South West. Phil Sheldrake, RSPB conservation officer, who has spent nine years working with the Cathedral to return peregrines to the Tower, assisted Dave Anderson.\n \nThe small \x91backpack\x92 worn by the female peregrine will allow experts to follow her movements 24/7 sending messages back to a control centre via mobile phone masts. Experts hope to learn more about where urban peregrines travel to hunt, particularly when finding food for their young. The tagging was filmed and the results will be shared in the new series of Springwatch starting on the Monday 29 May.\n \nThe female, named Sally by the Cathedral\x92s Clerk of Works Gary Price, was also given a blue colour-ring bearing the initials SY. Her mate, who was named Sebastian, was ringed with a distinctive blue ring bearing the initials SB.\n \nPhil Sheldrake, RSPB Conservation Officer said: \x93This is groundbreaking for us and another chapter in the story of the Cathedral peregrines. We started the re-introduction programme nine years ago and it has gone from strength to strength. The more we know about our birds, the better. It was not long ago that the population was decimated but now the numbers are slowly starting to build and research like this will contribute to that process.\x94\n \nDave Anderson said: \x93The satellite tagging went very smoothly and the female remained calm and quiet throughout, which is always a good thing. The aim is to work as quickly as possible to minimise the time that the bird is off the nest. The tag we put on is only temporary, fixed with hemp stitches that will gradually rot, so that it will eventually fall off. In the meantime, we hope to discover a lot more about peregrines, particularly given that they are known to travel great distances in search of food and territory.\x94\n \nTo add to the excitement, a chick has already hatched but as yet no sign of any more hatchlings. The peregrines produced five eggs in all this year, an unusually high number indicating that there is plenty of food to be had in the area. If all the eggs hatch the parents will be busy hunting a variety of different birds to feed their young. Diving at up to 180 miles per hour, the peregrine is the fastest bird in the world. The falcons hunt both by day and at night, using the light from Salisbury\x92s street lamps and the Cathedral\x92s floodlights to see their prey.\n \nVictoria Webb, BBC Springwatch producer, said: \x93This is a very exciting development and means that we can bring viewers cutting edge information about one of our most beautiful raptors. We have been watching the Cathedral pair for a while now via our remote cameras, and their unfolding story will be told in the new series.\x94\n \nPeregrine numbers have been increasing in towns and cities across the UK during the past 20 years. They returned to nest on Salisbury Cathedral in 2014 after an absence of 61 years. Urban peregrines, such as those at the Cathedral, stay both local to where they hatched and travel as far as Yorkshire and Norfolk from the west. Aveline, a female peregrine hatched last year at the Cathedral, was spotted at the Floodplain Nature Reserve, Milton Keynes, in January of this year.\n \nThe rings and tagging not only provide valuable information to experts but also afford the peregrines a degree of protection because they can be identified and traced via their rings, or in the case of the female, via the new tracking device that will remain in place for between one and three years. This may help to combat the recent spate of incidents nationwide involving peregrine persecution.\n", 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/NtlcRss_86U', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-05-17', 'timestamp': '2017-05-17 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/E_BVItuHecE?start=1424" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': ' Incubating eggs / Hunting / feeding / Sally being GPS tagged\n\n', 'description': ' Incubating eggs / Hunting / feeding / Sally being GPS tagged\n\n', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/E_BVItuHecE?t=1424', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-05-17', 'timestamp': '2017-05-17 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/BjpkrJ6VFP8" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Too many eggs for Sebastian, the male falcon \n', 'description': 'We have noticed that the incubating male peregrine seems to find it hard to fit all the eggs underneath him. He shuffles around from time to time to ensure that all of them are covered but you can see here that, as he hunkers down, an egg gets pushed out to the side.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=BjpkrJ6VFP8&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=43', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-05-19', 'timestamp': '2017-05-19 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/BjpkrJ6VFP8" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'First sight of the chick', 'description': 'Chick hatches, sally and sebastian hunts feeds', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/dapGWqOMpK4?t=2961', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-05-19', 'timestamp': '2017-05-19 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/BjpkrJ6VFP8" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'First sight of the chick \n', 'description': "This was our first sighting of the chick or 'eyas', which is tiny and not able to sit up or move about easily. We captured this footage at about 14.30.\n\nThe parents start to feed the chick within 24 hours.To start off with it has the downy white feathers but over the course of the next three to five weeks these will be replaced by darker, stiffer juvenile feathers . We'll ring this chick when it is approximately three weeks old. This will be done Ed Drewitt, our regular peregrine ringer.\n", 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=BjpkrJ6VFP8&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=43', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-05-20', 'timestamp': '2017-05-20 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/RMR4AyS4g8E" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'A domestic tiff ', 'description': 'We caught this domestic tiff on the Tower balcony camera that looks down the walkway from the nesting box, where the peregrines keep their larder. \n\nAn adult peregrine will eat around 70 grams or 2.5 ounces of food per day. Other birds make up the majority of their prey and pigeons are big on the peregrine menu.\n\nWhen they are hunting, peregrines fly above their prey, then fold their wings back and dive down at speeds of up to 200mph, often striking their target dead on impact. This dive is called the stoop. At other times they grab their prey in the air.\n\nThe fact that their attacks take place when they are airborne explains why pigeons stroll past the nest without batting a proverbial eyelid.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=RMR4AyS4g8E&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=40', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-05-24', 'timestamp': '2017-05-24 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/LXTUtMyubWQ" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'RSPB Salisbury Cathedral Peregrines - breakfast\n', 'description': 'Fetching the remains of breakfast from the larder 24th May 2017 - footage shown with kind permission from Salisbury Cathedral and featured on BBC Springwatch.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=LXTUtMyubWQ', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-01', 'timestamp': '2017-06-01 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/29ronISbPLk?start=485" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Feeding / Rural peregrine ', 'description': 'Feeding / Rural peregrine ', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/29ronISbPLk?t=485', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-03', 'timestamp': '2017-06-03 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/k12khImtdYg?start=2204" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Wet Sally on nest / Seb eating / Sally fetching food from parapet \x91larder\x92\n', 'description': 'Wet Sally on nest / Seb eating / Sally fetching food from parapet \x91larder\x92\n', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/k12khImtdYg?t=2204', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-07', 'timestamp': '2017-06-07 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/SY_UrJehDFw" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Why is there an extra chick in our peregrine nest?\n', 'description': 'Salisbury Cathedral Peregrines adopt a youngster.\n\nOn 31 May two peregrines were poisoned at Clee Hill in Shropshire, leaving three orphaned chicks. The RSPB contacted the Cathedral and asked if they would adopt one of the chicks, offering it the chance to be a wild rather than hand reared bird. \n\nThe Cathedral was chosen because the nesting area is particularly safe and there was only one chick in the nest - and the nest had the added advantage of having cameras on it, allowing experts to observe the adoption process safely and at (almost) first hand.\n\nThe two and a half week old chick was introduced to our falcons on the morning of 7 June. This is his story\x85\n\nDene was joined recently by Wylye, an orphan chick from Shropshire whose parents had been poisoned. The adoption went brilliantly and Wylye was soon a happy part of the family.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=SY_UrJehDFw&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=33', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-07', 'timestamp': '2017-06-07 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/vERKAzOLQs0?start=645" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'extra chick in our peregrine nest Cliff rescue / Salisbury Cathedral Peregrines adopt a youngster.\n', 'description': "Wylye was rescued by the RSPB along with his two siblings after their parents were killed by poisoned bait. The RSPB investigations team decided to foster the orphaned chicks into carefully selected nests in the wild. They wanted the chicks to have the opportunity to grow up wild rather than as captive peregrines. A suitable nest was identified in the Midlands for Wylye's two brothers, and the Cathedral agreed to offer him a home.\n \nOn 7 June the RSPB team put Wylye in the Salisbury Cathedral nest. Dene looked a little surprised but tolerated the intruder and, after a tense wait, the female, Sally returned to the nest and fed Dene first before moving on to feed Wylye. A good sign..\n", 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/vERKAzOLQs0?t=645', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-08', 'timestamp': '2017-06-08 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/BF12lFvtMfo" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Dad provides a mid-morning feast', 'description': 'Just before midday Dad swoops down to the nest with a tasty morsel. While the chicks are small the female does most of the work on the nestbox, brooding and feeding the youngsters while the male supplies the food. However, as the chicks grow she starts to take on more hunting duties.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=BF12lFvtMfo&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=28', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-08', 'timestamp': '2017-06-08 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/BohNEOY7M64" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Learning to use the step - or not!\n', 'description': 'We watched the orphan across the course of a day and he would regularly jump out of the nest and then find it hard to get back in. Together with RSPB Conservation Officer, Phil Sheldrake, we decided to pop a couple of spare stones from the Works Yard next to the box to see if it made things any easier for him. You judge for yourselves...a moderate success perhaps but anything to ensure he gets well fed.', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=BohNEOY7M64&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=29', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-08', 'timestamp': '2017-06-08 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/jGIVCVk4Y_o" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'The chicks are getting plenty to eat', 'description': "Around 14.00 we checked in to see how things were going on the nest box and witnessed yet another feast. Check out the bulges in the chicks' necks. These are their 'crops' , or food storage areas, that allow them to eat more than their stomach can handle. Once the crop is full, the chick will quietly snooze and slowly process the food over several hours as it passes from crop to stomach.\n", 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=jGIVCVk4Y_o&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=30', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-08', 'timestamp': '2017-06-08 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/UJrl01vMCuI" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Settling down for the night', 'description': 'Just after 20.00 the chicks nestle down with the female for the night. The chicks are old enough to leave alone for extended periods now and the orphan chick is very mobile. He grows more independent as each day goes by.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=UJrl01vMCuI&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=31', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-08', 'timestamp': '2017-06-08 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/LvXLcd3nqH4?start=1132" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Chicks getting acquainted \n', 'description': 'Feeding', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/LvXLcd3nqH4?t=1131', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-10', 'timestamp': '2017-06-10 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/Tm2XlvHmGQk" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Chicks are named and ringed', 'description': 'We ringed and named our chicks today. Join Amber Rawlings, our marketing assistant and 9-year-old Amelia, daughter of our Cathedral stonemason, Alan Spittle, as they do the honours.      The two peregrine chicks that have been starred on Springwatch 2017 have been named and ringed. \n\nOn Saturday afternoon (10 June) Specialist Hamish Smith (assisted by RSPB Conservation Officer Phil Sheldrake and his daughter Ellie) ringed, measured and weighed the two male falcon chicks. By popular request the chick that hatched in the nest was called Dene, in memory of the Cathedral facilities manager Dene Turner, who died in 2012. Dene was fitted with a blue ring bearing the initials KV.\n\nOur adopted chick was named Wylye by nine-year-old Amelia, daughter of stonemason Alan Spittle. Amelia pulled his name out of an envelope containing names submitted by Cathedral staff. He was given a blue ring bearing the initials KT.', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=Tm2XlvHmGQk&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=32', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-14', 'timestamp': '2017-06-14 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/PkRR8gnSmcs?start=3166" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'chicks fed by sally', 'description': 'nan', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/PkRR8gnSmcs?t=3166', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-06-28', 'timestamp': '2017-06-28 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/lYWUmXD4Ozw?start=813" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'wyley fledges', 'description': 'wyley is first to fledge being that he is 6 days older than dene', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/lYWUmXD4Ozw?t=812', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-07-01', 'timestamp': '2017-07-01 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/88YDL5u9nuo" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Dene finally manages to fly up onto the parapet', 'description': 'The Cathedral balcony is great because they have plenty of safe space to run and practice their flapping. By the time the chicks finally get strong enough to make it onto the balcony parapet, they are just about ready to fly. We have had some crash landings in the past. Last year one of the chicks, Raphael, flew down to near the North Porch and got caught in high winds so was unable to get up again. He had to give him a helping hand - but so far things have been going well with Dene, our original chick (ring initials KV). \n\nHaving hunted through our recorded footage we think this is the actual moment when he managed to launch himself. Note how he used the nestbox to help, just like Wylye the orphan (ring initials KT)\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=88YDL5u9nuo&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=27', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-07-02', 'timestamp': '2017-07-02 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/lYWUmXD4Ozw" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'dene fledges', 'description': 'dene fledges', 'location': 'salisbury cathedral tower', 'video': 'https://youtu.be/lYWUmXD4Ozw?t=862', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-07-02', 'timestamp': '2017-07-02 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/8zwQKmy4PYo" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Dene brings a kill home to the nest box\n', 'description': "We're pretty sure that this is our original chick, Dene, bringing home food. If you look carefully at the blue ring on his left leg the initials look like a K and a V. If we are correct then he is hunting independently now.\n", 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=8zwQKmy4PYo&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=24', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-07-03', 'timestamp': '2017-07-03 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/2Q-B7AY02Kk" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Sally feeding on the balcony\n', 'description': 'This footage was gathered at around 06.00am. Both chicks have now fledged and appear periodically on the balcony but sightings of them have reduced considerably. Nowadays you are more likely to spot them by joining the RSPB Date with Nature team on the ground. They have the telescopes set up and trained on the Tower and if you are lucky you can catch the youngsters honing their flying and hunting skills.\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=2Q-B7AY02Kk&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=26', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2017-07-03', 'timestamp': '2017-07-03 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/0EA8o8o83sE" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Pigeon an early morning visitor on the balcony\n', 'description': 'Throughout the time the peregrines have been nesting cheeky old pigeons have been hanging around. Early in the morning on 3 July this pigeon popped in for a look around. Luckily no-one was home.', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=0EA8o8o83sE&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=25', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2018-04-01', 'timestamp': '2018-04-01 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/us6_B76av1s" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': "Moving in: There's a new peregrine in town ", 'description': 'On 1 April the nestbox cameras were turned on. \n peregrine cam was switched on at the start of April and almost immediately an un-ringed peregrine is observed on the nestbox. The peregrine returns several times a day to \'prospect\' the site. \n\nEach time a visit takes place, Sally the resident peregrine appears shortly afterwards. She can be identified by her blue ring (initial SY) and her GPS tracker. Is she staking her claim?\n\nPeregrines are very territorial and fights over nesting sites are not uncommon. Given the difference in size (the male or tercel is much smaller than the female) a female peregrine will only fight a female for the nest, and a male will only challenge a male. \nNot long after the sighting with Sally, the new male appeared on the nest box with an unringed female. Data from Sally\x92s transmitter showed she was around and she soon appears on camera, visiting the nest box when the new couple were away. The peregrine team began to watch anxiously. They could see trouble ahead as Granville explains:\n \n"We anxiously waited to see who would become the dominant female and actually lay a clutch of eggs. We were at this stage a little concerned that there were no eggs in the box in early April as other urban pairs we knew of had full clutches by then; perhaps it was just the cold weather delaying things; who knows perhaps both females might try to lay eggs in the box."\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=us6_B76av1s&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=13', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2018-04-04', 'timestamp': '2018-04-04 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/_BHex0RVrJM" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Trouble ahead: A courting couple have their eyes on the nestbox', 'description': "On the 4 April two un-ringed peregrines are observed on the nestbox. They returned several times during the day and display courtship behaviour, with the male bowing to the female and raising his tail as he lowers his head. \n\nThe female begins to scrape at the gravel, creating a hollow to nest in.\n\nJust over an hour after the pair leave the nest, Sally appears and spends time on the nest. \n\nSo far the two parties have not met. There could be trouble if they do because peregrines are very territorial and fights over prime 'real estate' are not uncommon.\nAs April progressed the unringed couple became regular nestbox visitors and Sally\x92s tracker showed that she was also visiting the Tower frequently. The nest box cameras catch the unringed pair on video looking as though they were there to stay. Sally appeared on her own. Would she let the others lay eggs on 'her' nest?\n", 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=_BHex0RVrJM&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=20', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2018-04-10', 'timestamp': '2018-04-10 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/CX4tHGCBlTM" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'April romance: The calm before the storm\n', 'description': "Throughout April the un-ringed peregrine pair visit the Cathedral nest box more and more frequently, making forays into the 'larder' end of the landing, where nesting peregrines usually store their food.\n\nHowever, Sally's visits are on the increase too but she is always alone. \n\nIt's worth remembering that peregrines females are more loyal to their nests than they are to their mates, especially if they have nested successfully on that site. How will Sally handle the prospecting couple checking out 'her' nest box?\n", 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=CX4tHGCBlTM&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=17', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2018-04-23', 'timestamp': '2018-04-23 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/ZOSjBDg32Mc" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Battle Royal on the Tower: Sally attacks the interlopers ( Part One)', 'description': 'During April the un-ringed falcons increased the number of visits they were making to the nest. Each time they visited Sally would return (alone) to check the nestbox. Things came to a head just before 21.00 on Monday 23 April when the un-ringed female challenged Sally for the nestbox.\n\nFemale peregrines are very loyal to nest sites particularly if they have successfully raised chicks there. In this case, the site is all the more precious because peregrines nest of craggy cliffs and quarries, which the Cathedral Tower resembles, and there are not many suitable spots in the rolling hills of Wiltshire. The Cathedral\'s nest box is therefore prime real estate and something worth fighting for.\n\nHowever, the fight is ferocious and someone has to yield. Please don\'t view if you think this will upset you.\nThings appeared to reach a stalemate. Granville takes up the story again:\n"On the evening of Monday 23 April things really did come to a head. Captured on video is a battle lasting the best part of an hour between the two females, the fight taking place on the walkway adjacent to the nest box. Both birds can be seen with talons locked, pecking at each other and rolling around on the walkway in a really vicious fight with feathers flying in all directions."\nThe fight is so brutal so that if this sort of footage is likely to upset you, we suggest you don\x92t watch the film below:\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=ZOSjBDg32Mc&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=19', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2018-04-23', 'timestamp': '2018-04-23 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/XjEhd5Ec-GE" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Nest Box Wars: Sally mounts a stout defence (Part Two)\n', 'description': 'For nearly an hour Sally battles to keep her nest. The challenger is an un-ringed female, who has been visiting the nestbox regularly with her mate.\n\nSally needs to win this battle if she wants to keep her place on the Cathedral Tower and the nestbox on which she has successfully raised chicks already.\nThe battle took place at both ends of the balcony, taking the best part of an hour. Sally appears to have emerged victorious and the cameras record her sitting on the nestbox through the night and into the morning. Again, the following footage may be distressing to some people:\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=XjEhd5Ec-GE&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=18', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2018-04-25', 'timestamp': '2018-04-25 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/ag33wL9eUGE" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': "Salisbury peregrines: What's next for Sally?", 'description': 'After the dramatic battle for the nestbox, which Sally won, we thought the male might take up with her. At that point there was still time for her to lay eggs and fledge the chicks before winter.\n\nHowever, a few days after the fight, however, the un-ringed peregrine pair return to the nest and resume courting. Sally is never far behind and her tracker shows that she is often perched on the Tower.\n\nThe cameras are monitored at intervals and the footage shows that the last time the courting pair are seen together is 5 May. In early June one un-ringed peregrine is absent while the other remains, sharing the Tower with Sally.\n\nThere has been much discussion about the events of March, April and May and there are two theories. Either Sally disrupted a pair and prevented them from laying - or Sally lost Sebastian, found a new un-ringed mate and then a new un-ringed female swooped in and stole him.\n\nWe may never know the truth but the GPS tracker and blue ID rings have opened our eyes to a new world up on the Tower. Without the means of identification we would have had no idea that the male was not Sebastian, or indeed that Sebastian had gone missing....and Sally\'s tracker tells us exactly what she has been up to.\n\nIt\'s sad there are no chicks but it has been a fascinating episode from which we are learning a lot and gathering fascinating material. \nIt was a relief that there were no fatalities that night. Fights can sometimes result in the death of one of the birds. The timing of the battle was such that it offered a small window of opportunity for late egg laying, as Granville explains:\n\x93Our hopes were high that having seemingly vanquished the new female, Sally and the male would now settle down and lay an albeit late clutch of eggs. Alas it was not to be, and as I type this note in late May, there are no eggs laid and the same three birds are still present at the site. Sadly it seems that there will be no breeding attempt at the site this year.\x94\nThe behaviour witnessed on the Tower piqued the team\'s interest. In spite of the fact that there were no chicks to watch a decision was taken to keep the cameras on just a little longer. In early June Sally appears to be back in charge on the Tower but there\x92s still a stranger around. Who is the unringed peregrine and is he here to stay? If only we had some way of identifying him - but that\x92s another story.\nSally still has her tracker on so we can follow her movements even when the cameras are down. We\'d also like your help finding out more about our pergerines. We have ringed every chick hatched on the Tower since 2014. They all wear the distinctive blue colour ring bearing their unique ID initials and we\'d love to hear from anyone who spots them. Details of the rings are below:\n\nLooking back over an eventful season, Granville Pictor is philosophical:\n\x93Whilst the failure to breed this year is disappointing, the video footage does reveal fascinating insights into the territorial behaviour of peregrines. The results of the very recently published 2014 British Trust for Ornithology National Peregrine survey reveals that the species is thriving in southern England, with a big increase in numbers breeding with success on man made structures like the Cathedral. With increasing numbers of adult birds joining the population and seeking territories, it is perhaps not surprising that pressure to breed on a relatively limited number of nest sites is increasing and territorial disputes such as seen this year at Salisbury may become more commonplace."\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=ag33wL9eUGE&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=12', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2018-07-05', 'timestamp': '2018-07-05 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/YZQP3trPFvA" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Sally is still in residence Thursday ', 'description': 'We keep an eye on the cameras up the Tower just to see what Sally is up to. On 5 July we caught up with her on the balcony enjoying her evening meal at around 19.00.\n\nAn unringed male visits the balcony regularly and sits on the parapet, however, we have never seen the pair together (if indeed they are a pair).\n', 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=YZQP3trPFvA&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=11', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2018-10-26', 'timestamp': '2018-10-26 00:00:00', 'popup': '<iframe width="560" height="315" src="https://www.youtube.com/embed/xFMzo75vxzc" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>', 'title': 'Peregrine Update: Unknown Falcon Spotted', 'description': "Gary, our Clerk of Works, spruces up the nest box for Sally, our resident Peregrine falcon. At the same time, he's hoping to get more footage of an unknown Peregrine which has been spotted on our cameras, and hopefully, determine its gender. If it's a male, it could be good news for Sally!", 'location': 'salisbury cathedral tower', 'video': 'https://www.youtube.com/watch?v=xFMzo75vxzc&list=PLo5fqqdNk4Z_CDAW0zWwBMh0WrzcGWejR&index=9', 'icon': 'marker', 'iconstyle': {'iconUrl': 'https://static.thenounproject.com/png/366530-200.png', 'fillOpacity': 0.8, 'stroke': 'true', 'radius': 7}}}, {'type': 'Feature', 'geometry': {'type': 'Point', 'coordinates': [-1.797503, 51.065596]}, 'properties': {'time': '2019-03-11', 'timestamp':
